        private string GetGroupFields(int sortByValue)
        {

            switch (sortByValue)
            {
                case 1:
                    return "[Source]";
                case 2:
                    return "[DocumentVoucher]";
                case 3:
                    return "[PostDate]";
                case 4:
                    return "[Source]";
                case 5:
                    return "[Vendor]";
                case 6:
                    return "[Well]";
                case 7:
                    return "[Owner]";
                default:
                    return string.Empty;
            }
        }

        // Method to determine the label text expression based on the plngSortBy parameter
        private string GetLabelText(int sortByValue)
        {
            switch (sortByValue)
            {
                case 1:
                    return "Source:";
                case 2:
                    return "Document Voucher:";
                case 3:
                    return "Post Date:";
                case 4:
                    return "Source:";
                case 5:
                    return "Entity:";
                case 6:
                    return "Well:";
                case 7:
                    return "Owner:";
                default:
                    return "Unknown Sorting:";
            }
        }
